function convertProjectString($projectString) {
    // Regex untuk menangkap proyek dengan nama lebih dari satu kata
    preg_match('/^(.+?)\s+(CE-[A-Z0-9]+)\s+([A-Za-z0-9]+)$/', trim($projectString), $matches);

    // Memastikan bahwa kita mendapatkan semua bagian yang diperlukan
    if (count($matches) < 4) {
        return null; // Format tidak valid
    }

    // Mengambil bagian yang relevan
    $projectName = trim($matches[1]); // Nama proyek bisa lebih dari satu kata
    $apiKey = trim($matches[2]);      // API Key (dengan prefiks "CE-")
    $apiToken = trim($matches[3]);    // API Token

    // Mengembalikan array dalam format yang diinginkan
    return [
        $projectName => [
            "api_key" => $apiKey,
            "api_token" => $apiToken,
        ]
    ];
}

